def get_listings(dataset_name: Literal["mnist", "cmnist", "fashion_mnist"] = "mnist") -> Set[str]:
    """
    Get the list of images that should be unlearned from the MNIST, C_MNIST, and Fashion_MNIST.

    Parameters:
        str (string): The dataset to use. Can be one of "mnist", "cmnist", or "fashion_mnist". Default is "mnist"

    Returns:
        Set[str]: The list of images that should be unlearned.
    """

    if dataset_name == "mnist":
        return MNIST, "7e"
    elif dataset_name == "cmnist":
        return C_MNIST, "7e"
    elif dataset_name == "fashion_mnist":
        return FASHION_MNIST, "5e"
    else:
        raise Exception(f"Dataset '{dataset_name}' not supported.")
